(672, 934, 'peliculas', 'e168a782-b025-49b2-bd10-4ceb4f1ae2c0', '{\"genero\": \"Accion \", \"status\": \"activo\", \"titulo\": \"Warfare\", \"duracion\": 95, \"poster_url\": \"920b4522-0047-4fea-b9fb-4b62c265e5da\", \"descripcion\": \"Basada en las experiencias reales del ex marine Ray Mendoza (codirector y coguionista de la película) durante la guerra de Irak. Introduce al espectador en la experiencia de un pelotón de Navy SEALs estadounidenses. Concretamente en una misión de vigilancia que se tuerce en territorio insurgente. Una historia visceral y a pie de campo sobre la guerra moderna y la hermandad, contada como nunca antes: en tiempo real y basada en los recuerdos de quienes la vivieron.\", \"trailer_url\": \"https://www.youtube.com/watch?v=JER0Fkyy3tw\", \"clasificacion\": \"+13\"}', '{\"genero\": \"Accion \", \"status\": \"activo\", \"titulo\": \"Warfare\", \"duracion\": 95, \"poster_url\": \"920b4522-0047-4fea-b9fb-4b62c265e5da\", \"descripcion\": \"Basada en las experiencias reales del ex marine Ray Mendoza (codirector y coguionista de la película) durante la guerra de Irak. Introduce al espectador en la experiencia de un pelotón de Navy SEALs estadounidenses. Concretamente en una misión de vigilancia que se tuerce en territorio insurgente. Una historia visceral y a pie de campo sobre la guerra moderna y la hermandad, contada como nunca antes: en tiempo real y basada en los recuerdos de quienes la vivieron.\", \"trailer_url\": \"https://www.youtube.com/watch?v=JER0Fkyy3tw\", \"clasificacion\": \"+13\"}', NULL, NULL);
