INSERT INTO `peliculas` (`id`, `status`, `sort`, `user_created`, `date_created`, `user_updated`, `date_updated`, `titulo`, `descripcion`, `duracion`, `genero`, `clasificacion`, `trailer_url`, `poster_url`) VALUES
('a0a949b5-b97f-42a7-86bc-be42895e8988', 'activo', NULL, '07746af4-15bd-4595-8275-8ba46c75da12', '2025-05-27 13:47:51', '07746af4-15bd-4595-8275-8ba46c75da12', '2025-05-29 22:39:25', 'Minecraft', 'Cuatro inadaptados son absorbidos de repente por un misterioso portal hacia el Supramundo: un extraño y cúbico país de las maravillas que vive gracias a la imaginación. Para volver a casa, se embarcan en una búsqueda mágica con un artesano.', 120, 'Acción', 'TP', 'https://www.youtube.com/watch?v=W_l7bXqWZyY', '263af2a4-e26d-4778-8d18-f227c6b6a241'),
('bf60cc62-e40d-49a4-950d-41a823d8fd49', 'activo', NULL, '07746af4-15bd-4595-8275-8ba46c75da12', '2025-05-28 11:08:30', '07746af4-15bd-4595-8275-8ba46c75da12', '2025-05-29 22:38:57', 'Lilo & Stitch', 'Remake en imagen real de \"Lilo & Stitch\". Narra la historia de una niña hawaiana solitaria y un extraterrestre fugitivo que la ayuda a recomponer su familia rota.\r\n\r\n', 130, 'Animación', 'TP', 'https://www.youtube.com/watch?v=VWqJifMMgZE', 'e9df0cfb-5699-44f4-b129-a7956a54480a'),
('c41f9602-9ddc-437b-8e75-f2b3fc3ef1de', 'activo', NULL, '07746af4-15bd-4595-8275-8ba46c75da12', '2025-05-29 10:25:32', NULL, NULL, 'Destino Final 6: Lazos de Sangre', 'En Destino Final 6: Lazos de Sangre, la estudiante Stefani tiene pesadillas recurrentes sobre un accidente de los años 60 que involucra a su abuela. Descubre que la muerte ha estado persiguiendo a la línea familiar desde entonces, amenazando con una nueva serie de muertes violentas y absurdas si no puede encontrar una manera de detenerla', 123, 'Terror', '+18', 'https://www.youtube.com/watch?v=NkcT00FMTu8', '2706d471-64f5-4735-a4b9-465f44a2646f'),
('e168a782-b025-49b2-bd10-4ceb4f1ae2c0', 'activo', NULL, '07746af4-15bd-4595-8275-8ba46c75da12', '2025-06-01 16:19:06', NULL, NULL, 'Warfare', 'Basada en las experiencias reales del ex marine Ray Mendoza (codirector y coguionista de la película) durante la guerra de Irak. Introduce al espectador en la experiencia de un pelotón de Navy SEALs estadounidenses. Concretamente en una misión de vigilancia que se tuerce en territorio insurgente. Una historia visceral y a pie de campo sobre la guerra moderna y la hermandad, contada como nunca antes: en tiempo real y basada en los recuerdos de quienes la vivieron.', 95, 'Accion ', '+13', 'https://www.youtube.com/watch?v=JER0Fkyy3tw', '920b4522-0047-4fea-b9fb-4b62c265e5da');
